  return (
    <div className="navbar">
      {/* Left: Logo + Menu */}
      <div className="navbar-left">
        <FaBars className="icon menu-icon" title="Menu" />
        <h2 className="logo-text">üçΩÔ∏è FoodieHub</h2>
      </div>

      {/* Center: Search */}
      <div className="navbar-search">
        {/* <input type="text" placeholder="Search dishes or restaurants..." /> */}
        <l>Home</l>
         <l>menu</l>
          <l>Home</l>
           <l>Home</l>
      </div>

